INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2020/04/30 12:00:00", "リン", "あたしだって\nやるときはやるよ！", 102601, 24001, 1, 0.0, 0.0, 0, 10040, 1, 24, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2020/04/30 12:00:00", "リン", "ふぅ…\nこれであたしの仕事は\n終わりだね", 102601, 24002, 1, 0.0, 0.0, 1, 10040, 1, 24, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2020/04/30 12:00:00", "リン", "終わった終わった\n一人でもなんとか\nなるもんだね", 102601, 24003, 1, 0.0, 0.0, 2, 10040, 1, 24, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2020/04/30 12:00:00", "リン", "やったね！\nこれでようやく\nサボれるよ…", 102601, 24004, 2, 0.0, 0.0, 3, 10040, 2, 24, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2020/04/30 12:00:00", "リン", "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 102601, 24005, 1, 0.0, 0.0, 4, 10040, 1, 24, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2020/04/30 12:00:00", "リン", "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 102601, 24006, 2, 0.0, 0.0, 5, 10040, 2, 24, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2020/04/30 12:00:00", "リン", "あたしも意外と\nやるもんでしょ？", 102601, 24007, 2, 0.0, 0.0, 6, 10040, 2, 24, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2020/04/30 12:00:00", "リン", "疲れた…\nねずみの逃げ足\n速すぎるよ…", 102601, 24008, 4, 0.0, 0.0, 7, 10040, 4, 24, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2020/04/30 12:00:00", "リン", "このままじゃ\nまっひ～に\n叱られちゃうよ", 102601, 24009, 4, 0.0, 0.0, 8, 10040, 4, 24, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2020/04/30 12:00:00", "リン", "まじめに\nやったんだけどな…\n悔しいな～", 102601, 24010, 4, 0.0, 0.0, 9, 10040, 4, 24, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2020/04/30 12:00:00", "リン", "やられた…\nねずみって意外と\nてごわいね", 102601, 24011, 4, 0.0, 0.0, 10, 10040, 4, 24, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2020/04/30 12:00:00", "リン", "おのれ～\nあたしのチーズを\n盗みやがって～！", 102601, 24012, 4, 0.0, 0.0, 11, 10040, 4, 24, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES ("2020/04/30 12:00:00", "リン", "疲れた…\nけど、次こそは\n守り抜くよ…", 102601, 24013, 4, 0.0, 1.81, 12, 10040, 1, 24, "2030/12/17 14:59:59", 0.0);
